func readLines(path string) ([]string, error) {
	file, err := os.Open(path)
	if err != nil {
		return nil, err
	}
	defer file.Close()
	var lines []string
	scanner := bufio.NewScanner(file)
	for scanner.Scan() {
		lines = append(lines, scanner.Text())
	}
	return lines, scanner.Err()
}

func load() {
	l = make([]int, 10000000)
	lines, err := readLines("arr.txt")
	for i, line := range lines {
		if i <= len(l) {
			l[i], err = strconv.Atoi(line)
		}
		if err != nil {
			fmt.Println(err)
		}
	}
}

func BenchmarkMergesort(b *testing.B) {
	load()
	b.ResetTimer()
	for n := 0; n < b.N; n++ {
		mergeSort(l)
	}
}

func aBenchmarkMergesortAsync(b *testing.B) {
	c := make(chan []int)
	b.ResetTimer()
	for n := 0; n < b.N; n++ {
		mergeSortAsync(l, c)
		l = <-c
	}
}

func BenchmarkQuicksort(b *testing.B) {
	b.ResetTimer()
	for n := 0; n < b.N; n++ {
		sort.Ints(l)
	}
}
